import {React, useState} from 'react'

import './Rnote.css'

import Global from '../Global.js'

const Rnote = () => {
    const [note, setNote] = useState(
        Global.notes[Math.floor(Math.random() * Global.notes.length)]
    )
    const handleClick = () => {
        setNote(
            Global.notes[Math.floor(Math.random() * Global.notes.length)]
        )
    }

    return(
        <div onClick={handleClick}>{note}</div>
    )
}

export default Rnote
